import React from 'react'

export default class GalleryItem extends React.Component {
    constructor(props) {
        super ( props );
        this.state = {
            expand : false
        }
    }
    render(){
        return(
            <div className={"gallery-item margin-10 gallery-item"}
                style={{
                    backgroundImage : 'url(/assets/' + this.props.url + ')' 
                }}
            />
        )
    }

}
